import * as GiIcons from "react-icons/gi";
import { FaHome } from 'react-icons/fa';
import { AiTwotoneCopy } from 'react-icons/ai'
import { BsPencilSquare } from 'react-icons/bs'

const homwPath = (word: string) => {
  return "/";
};

const demoPath = (word: string) => {
  return "/hanzi/" + word;
};

const testWithDrawingPath = (word: string) => {
  return "/hanzi/" + word + "/test?level=1";
};

const testPath = (word: string) => {
  return "/hanzi/" + word + "/test";
};

const dragAndDropPath = (word: string) => {
  return "/hanzi/" + word + "/drag_and_drop";
};

export const WordNavbarData = [
  {
    title: "字庫",
    path: homwPath,
    icon: <FaHome />,
    cName: "navbar-top"
  },
  {
    title: "字卡",
    path: demoPath,
    icon: <AiTwotoneCopy />,
    cName: "navbar-top"
  },
  {
    title: "配對圖字",
    path: dragAndDropPath,
    icon: <GiIcons.GiAbstract089 />,
    cName: "navbar-top"
  },
  {
    title: "看圖寫字",
    path: testWithDrawingPath,
    icon: <GiIcons.GiChessRook />,
    cName: "navbar-top"
  },
  {
    title: "測驗",
    path: testPath,
    icon: <GiIcons.GiChessQueen />,
    cName: "navbar-top"
  }
];
